import Header from "../components/header";
import Main from "../components/main";
import { Section, Section2, Section3 } from "../components/sections";
import Footer from "../components/footer";
import Article from "../components/article";

const Home = () => {
  return (
    <>
      <Header />
      <Main />
      <Article />
      <Section />

      <Section2 />
      <Section3 />

      <Footer />
    </>
  );
};
export default Home;
